import React from 'react'
import InvestmentEntry from './InvestmentEntry'

const InvestmentList = ({ currentInvestments }) => {
    console.log(currentInvestments)
    return(
        <div className='investment-list'>
            { currentInvestments.map(investment => <InvestmentEntry {...investment} key={investment._id} />) }
        </div>
    )
}

export default InvestmentList

//not listing investments - console log
